C.ayf=new L.P('With this demo you can try all features and themes in FlexColorScheme V4. Find a color scheme you like, experiment with the new surface blend modes and levels. See how the AppBar theme options work. Try the true black option for dark themes, along with computed dark themes.\n\nYou can also turn FlexColorScheme\'s theming OFF and see how a color scheme looks when using standard Flutter ThemeData.from a ColorScheme.\n\nThe new opinionated opt-in widget sub theming is ON, you can turn it OFF and see the differences. The sub theming defaults mimics Material 3 (You), mostly on corner radius of Widgets, but also TextTheme and its coloring. This demo does not adjust any widget properties, the theme is adjusted interactively and the Flutter  widgets change as the theme is modified via the controls.\n\nThe theming impact on widgets is shown in expandable cards with "Themed" headings. The three first themes are custom color schemes and are not built-in choices. In the packages tutorial you learn how to make your own custom color schemes and turn them into advanced themes with FlexColorScheme.\n\nYou can copy existing color schemes and make a custom version of it. Want to use a theme you configured? Copy setup code for active settings and paste it into your IDE. Settings in the demo are persisted.',null,null,null,null,null,null,null,null,null)
